INSERT INTO `api_account-performance-report` VALUES ('AccountCurrencyCode','Currency','currency','String','True','True','','Attribute','The currency of the Customer account.'),('AccountDescriptiveName','Account','account','String','True','True','','Attribute','The descriptive name of the Customer account.'),('AccountTimeZoneId','Time zone','timeZone','String','True','True','','Attribute','Name of the timezone selected for the Customer account. For example: \"(GMT-05:00) Eastern Time\". This field does not reflect the current state of daylight saving time for the timezone.'),('ActiveViewCpm','Active View avg. CPM','activeViewAvgCPM','Money','True','True','','Metric','Average cost of viewable impressions (ActiveViewImpressions).'),('ActiveViewCtr','Active View viewable CTR','activeViewViewableCTR','Double','True','True','','Metric','How often people clicked your ad after it became viewable.\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('ActiveViewImpressions','Active View viewable impressions','activeViewViewableImpressions','Long','True','True','','Metric','How often your ad has become viewable on a Display Network site.'),('ActiveViewMeasurability','Active View measurable impr. / impr.','activeViewMeasurableImprImpr','Double','True','True','','Metric','The ratio of impressions that could be measured by Active View over the number of served impressions.\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('ActiveViewMeasurableCost','Active View measurable cost','activeViewMeasurableCost','Money','True','True','','Metric','The cost of the impressions you received that were measurable by Active View.'),('ActiveViewMeasurableImpressions','Active View measurable impr.','activeViewMeasurableImpr','Long','True','True','','Metric','The number of times your ads are appearing on placements in positions where they can be seen.'),('ActiveViewViewability','Active View viewable impr. / measurable impr.','activeViewViewableImprMeasurableImpr','Double','True','True','','Metric','The percentage of time when your ad appeared on an Active View enabled site (measurable impressions) and was viewable (viewable impressions).\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('AdNetworkType1','Network','network','AdNetworkType1','True','True','UNKNOWN / unknown\nSEARCH / Search Network\nCONTENT / Display Network\nYOUTUBE_SEARCH / YouTube Search\nYOUTUBE_WATCH / YouTube Videos\n','Segment','First level network type.'),('AdNetworkType2','Network (with search partners)','networkWithSearchPartners','AdNetworkType2','True','True','UNKNOWN / unknown\nSEARCH / Google search\nSEARCH_PARTNERS / Search partners\nCONTENT / Display Network\nYOUTUBE_SEARCH / YouTube Search\nYOUTUBE_WATCH / YouTube Videos\n','Segment','Second level network type (includes search partners).'),('AllConversionRate','All conv. rate','allConvRate','Double','True','True','','Metric','AllConversions divided by total clicks that can be conversion-tracked. This is how often a click on your ad resulted in a conversion. Percentage returned as \"x.xx%\".\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('AllConversions','All conv.','allConv','Double','True','True','','Metric','Best estimate of the total number of conversions that AdWords drives. Includes website, cross-device, and phone call conversions. This field is formatted using US locale, i.e., using comma \",\" for thousands and dot \".\" for decimals.\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('AllConversionValue','All conv. value','allConvValue','Double','True','True','','Metric','The total value of all of your conversions, including those that are estimated.\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('AverageCost','Avg. Cost','avgCost','Money','True','True','','Metric','The average amount you pay per interaction. This amount is the total cost of your ads divided by the total number of interactions.'),('AverageCpc','Avg. CPC','avgCPC','Money','True','True','','Metric','The total cost of all clicks divided by the total number of clicks received.'),('AverageCpe','Avg. CPE','avgCPE','Double','True','True','','Metric','The average amount that youâ€™ve been charged for an ad engagement. This amount is the total cost of all ad engagements divided by the total number of ad engagements.\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('AverageCpm','Avg. CPM','avgCPM','Money','True','True','','Metric','Average Cost-per-thousand impressions (CPM).'),('AverageCpv','Avg. CPV','avgCPV','Double','True','True','','Metric','The average amount you pay each time someone views your ad. The average CPV is defined by the total cost of all ad views divided by the number of views.\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('AveragePosition','Avg. position','avgPosition','Double','True','True','','Metric','Your ad\'s position relative to those of other advertisers.\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('CanManageClients','Can manage clients','canManageClients','Enum','True','True','TRUE / true\nFALSE / false\n','Attribute','Indicates if the account is an MCC account (true) or a regular AdWords account (false).'),('Clicks','Clicks','clicks','Long','True','True','','Metric','The number of clicks.'),('ClickType','Click type','clickType','ClickType','True','False','URL_CLICKS / Headline\nCALLS / Phone calls\nOTHER / Other\nPRODUCT_EXTENSION_CLICKS / Product plusbox offer\nSITELINKS / Sitelink\nPRODUCT_LISTING_AD_CLICKS / Shopping ad - Standard\nGET_DIRECTIONS / Driving direction\nOFFER_PRINTS / Print offer\nBREADCRUMBS / Breadcrumbs\nCALL_TRACKING / Manually dialed phone calls\nMOBILE_CALL_TRACKING / Mobile phone calls\nLOCATION_EXPANSION / Get location details\nSTORE_LOCATOR / Show nearby locations\nAPP_DEEPLINK / App engagement ad deep link\nTABLE_EXTENSION / Table Extension\nVIDEO_WEBSITE_CLICKS / Website\nVIDEO_CALL_TO_ACTION_CLICKS / Call-to-Action overlay\nVIDEO_APP_STORE_CLICKS / App store\nVIDEO_CARD_ACTION_HEADLINE_CLICKS / Cards\nVIDEO_END_CAP_CLICKS / End cap\nCLICK_ON_ENGAGEMENT_AD / Click on engagement ad\nLOCATION_FORMAT_MAP / Map\nLOCATION_FORMAT_LANDING_PAGE / Go to landing page\nLOCATION_FORMAT_STORE_INFO / Go to store info\nLOCATION_FORMAT_DIRECTIONS / Directions\nLOCATION_FORMAT_CALL / Call\nLOCATION_FORMAT_TEXT / Text\nLOCATION_FORMAT_IMAGE / Image(s)\nBROADBAND_PLAN / Broadband Plan\nWIRELESS_PLAN / Wireless Plan\nVISUAL_SITELINKS / Visual Sitelinks\nUNKNOWN / unknown\n','Segment','The Impressions field will reflect how often the ad was served with that click type available. Since ads can serve with multiple click types displayed, impressions may be double counted and the totals may not be accurate.'),('ContentBudgetLostImpressionShare','Content Lost IS (budget)','contentLostISBudget','Double','True','True','','Metric','The estimated percent of times that your ad was eligible to show on the Display Network but didn\'t because your budget was too low. A percentage returned as \"xx.xx%\", or the special value \"> 90%\".\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('ContentImpressionShare','Content Impr. share','contentImprShare','Double','True','True','','Metric','The impressions youâ€™ve received on the Display Network divided by the estimated number of impressions you were eligible to receive. A percentage returned as \"xx.xx%\", or the special value \"< 10%\".\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('ContentRankLostImpressionShare','Content Lost IS (rank)','contentLostISRank','Double','True','True','','Metric','The estimated percentage of impressions on the Display Network that your ads didn\'t receive due to poor Ad Rank. A percentage returned as \"xx.xx%\", or the special value \"> 90%\".\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('ConversionCategoryName','Conversion category','conversionCategory','String','True','False','','Segment','A category that describes the action the user will take to complete a conversion. Prevents zero-conversion rows from being returned. Values: \"Download\", \"Lead\", \"Purchase/Sale\", \"Signup\", \"View of a key page\", and \"Other\".'),('ConversionRate','Conv. rate','convRate','Double','True','True','','Metric','The number of conversions divided by total clicks that can be tracked to conversions. Percentage returned as \"x.xx%\".\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('Conversions','Conversions','conversions','Double','True','True','','Metric','The number of conversions for all conversion actions that you have opted into optimization. This field is formatted using US locale, i.e., using comma \",\" for thousands and dot \".\" for decimals.\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('ConversionTrackerId','Conversion Tracker Id','conversionTrackerId','Long','True','False','','Segment','ID of the conversion tracker.'),('ConversionTypeName','Conversion name','conversionName','String','True','False','','Segment','The name of the conversion type. Prevents zero-conversion rows from being returned.'),('ConversionValue','Total conv. value','totalConvValue','Double','True','True','','Metric','The sum of conversion values for all conversions.\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('Cost','Cost','cost','Money','True','True','','Metric','The sum of your cost-per-click (CPC) and cost-per-thousand impressions (CPM) costs during this period.'),('CostPerAllConversion','Cost / all conv.','costAllConv','Money','True','True','','Metric','Total cost divided by all conversions.'),('CostPerConversion','Cost / conv.','costConv','Money','True','True','','Metric','The Cost attributable to conversion-tracked clicks divided by the number of conversions'),('CrossDeviceConversions','Cross-device conv.','crossDeviceConv','Double','True','True','','Metric','Conversions from when a customer clicks on an AdWords ad on one device, then converts on a different device or browser. Cross-device conversions are already included in your AllConversions column. This field is formatted using US locale, i.e., using comma \",\" for thousands and dot \".\" for decimals.\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('Ctr','CTR','ctr','Double','True','True','','Metric','The number of clicks your ad receives (Clicks) divided by the number of times your ad is shown (Impressions). Percentage returned as \"x.xx%\".\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('CustomerDescriptiveName','Client name','clientName','String','True','True','','Attribute','The descriptive name of the Customer.'),('Date','Day','day','Date','True','True','','Segment','The date formatted as yyyy-MM-dd.'),('DayOfWeek','Day of week','dayOfWeek','DayOfWeek','True','True','MONDAY / Monday\nTUESDAY / Tuesday\nWEDNESDAY / Wednesday\nTHURSDAY / Thursday\nFRIDAY / Friday\nSATURDAY / Saturday\nSUNDAY / Sunday\n','Segment','The name of the day of the week, e.g., \"Monday\".'),('Device','Device','device','DeviceType','True','True','UNKNOWN / Other\nDESKTOP / Computers\nHIGH_END_MOBILE / Mobile devices with full browsers\nTABLET / Tablets with full browsers\n','Segment','Device type where the impression was shown.'),('EngagementRate','Engagement rate','engagementRate','Double','True','True','','Metric','How often people engage with your ad after it\'s shown to them. This is the number of ad expansions divided by the number of times your ad is shown. Percentage returned as \"x.xx%\".\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('Engagements','Engagements','engagements','Long','True','True','','Metric','The number of engagements. An engagement occurs when a viewer expands your Lightbox ad. Also, in the future, other ad types may support engagement metrics.'),('ExternalConversionSource','Conversion source','conversionSource','External