ractions','Long','True','True','','Metric','The number of interactions. An interaction is the main user action associated with an ad formatâ€”clicks for text and shopping ads, views for video ads, and so on.'),('InteractionTypes','Interaction Types','interactionTypes','EnumSet','True','True','','Metric','The types of interactions that are reflected in the Interactions, InteractionRate, and AverageCost columns.'),('InvalidClickRate','Invalid click rate','invalidClickRate','Double','True','True','','Metric','The percentage (\"x.xx%\") of clicks filtered out of your total number of clicks (filtered + non-filtered clicks) during the reporting period.\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('InvalidClicks','Invalid clicks','invalidClicks','Long','True','True','','Metric','Number of clicks Google considers illegitimate and doesn\'t charge you for.'),('IsAutoTaggingEnabled','Auto tagging enabled','autoTaggingEnabled','Enum','True','True','TRUE / true\nFALSE / false\n','Attribute','Indicates if auto tagging is enabled on the account.'),('IsTestAccount','Test account','testAccount','Enum','True','True','TRUE / true\nFALSE / false\n','Attribute','Indicates if the account is a test account.'),('Month','Month','month','String','True','True','','Segment','The first day of the month, formatted as yyyy-MM-dd.'),('MonthOfYear','Month of Year','monthOfYear','MonthOfYear','True','True','JANUARY / January\nFEBRUARY / February\nMARCH / March\nAPRIL / April\nMAY / May\nJUNE / June\nJULY / July\nAUGUST / August\nSEPTEMBER / September\nOCTOBER / October\nNOVEMBER / November\nDECEMBER / December\n','Segment','The name of the month of the year, e.g., \"December\".'),('PrimaryCompanyName','Company name','companyName','String','True','True','','Attribute','Company name of the account.'),('Quarter','Quarter','quarter','String','True','True','','Segment','The first day of the quarter, formatted as yyyy-MM-dd. Uses the calendar year for quarters, e.g., the second quarter of 2014 starts on 2014-04-01.'),('SearchBudgetLostImpressionShare','Search Lost IS (budget)','searchLostISBudget','Double','True','True','','Metric','The estimated percent of times that your ad was eligible to show on the Search Network but didn\'t because your budget was too low. A percentage returned as \"xx.xx%\", or the special value \"> 90%\".\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('SearchExactMatchImpressionShare','Search Exact match IS','searchExactMatchIS','Double','True','True','','Metric','The impressions you\'ve received divided by the estimated number of impressions you were eligible to receive on the Search Network for search terms that matched your keywords exactly (or were close variants of your keyword), regardless of your keyword match types. A percentage returned as \"xx.xx%\", or the special value \"< 10%\".\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('SearchImpressionShare','Search Impr. share','searchImprShare','Double','True','True','','Metric','The impressions you\'ve received on the Search Network divided by the estimated number of impressions you were eligible to receive. A percentage returned as \"xx.xx%\", or the special value \"< 10%\".\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('SearchRankLostImpressionShare','Search Lost IS (rank)','searchLostISRank','Double','True','True','','Metric','The estimated percentage of impressions on the Search Network that your ads didn\'t receive due to poor Ad Rank. A percentage returned as \"xx.xx%\", or the special value \"> 90%\".\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is also true for <a href=\'/adwords/api/docs/guides/awql\'>AWQL</a>: <em>Only</em> the operators <code>&lt;</code> and <code>&gt;</code> are allowed in the <code>WHERE</code> clause.'),('Slot','Top vs. Other','topVsOther','Slot','True','True','SearchRhs / Google search: Side\nSearchTop / Google search: Top\nSearchOther / Google search: Other\nContent / Google Display Network\nAfsTop / Search partners: Top\nAfsOther / Search partners: Other\nUnknown / \n','Segment','The position of the Ad.'),('ValuePerAllConversion','Value / all conv.','valueAllConv','Double','True','True','','Metric','The value, on average, of all conversions.\nTo prevent calculation accuracy issues, fields whose data type is <code>Double</code> can be used <em>only</em> with the following operators in predicates: <code>LESS_THAN</code> or <code>GREATER_THAN</code>. This is